import React, {Component} from 'react';

class News extends Component {

    render() {
        const news_Array=[
            {id:"01",title:"这是标题1"},
            {id:"02",title:"这是标题2"},
            {id:"03",title:"这是标题3"},
            {id:"04",title:"这是标题4"}
        ]
        return (
            <div >
                {
                    news_Array.map((NewsObj)=>{
                        return <div className="News_content" key={NewsObj.id}>我是id{NewsObj.id},我是标题{NewsObj.title}</div>
                    })
                }
            </div>
        );
    }
}

export default News;
